import React from 'react'
import "./Card.css"
import star from "../../assets/svg/star.svg"

function Card(props) {
    const rating = props.cat.rating;
    var stars;
    for (let index = 0; index < rating; index++) {
        stars+= (<><img src={star}/></>);
    }
    const oneStar = <img src={star}/>;
    const secondStar = <img src={star}/>;
    const twoStars = oneStar.push(secondStar);
    return (
        <div className="animalCard">
            <img className="main-img" src={props.cat.imageURL}/>
            <h2>
                {props.cat.catName}
            </h2>
            <div className="card-start" id="rating">
                <h4>Rating: {props.cat.rating}</h4>
                {twoStars}
            </div>
            <div className="card-price" >
                <h4>{props.cat.description}</h4>
            </div>
        </div>
    )
}

export default Card
